import React, { useState, useEffect } from "react";
import axios from "axios";

function App() {
  const [location, setLocation] = useState("");
  const [places, setPlaces] = useState({});
  const [loading, setLoading] = useState(false);
  const [selectedCategory, setSelectedCategory] = useState("all");

  const fetchPlaces = async () => {
    if (!location) return alert("Please enter a location");
    setLoading(true);
    try {
      const response = await axios.get(
        `http://localhost:5000/api/places?location=${location}`
      );
      // Filter out places without photo_url
      const filteredResults = {};
      for (const [category, placesArray] of Object.entries(response.data)) {
        filteredResults[category] = placesArray.filter(
          (place) => place.photo_url && place.photo_url !== ""
        );
      }
      setPlaces(filteredResults);
    } catch (error) {
      console.error("Error fetching places:", error);
      alert("Failed to fetch places.");
    }
    setLoading(false);
  };

  useEffect(() => {
    // Auto-detect location
    if (navigator.geolocation) {
      navigator.geolocation.getCurrentPosition(
        async (position) => {
          const { latitude, longitude } = position.coords;
          try {
            const response = await axios.get(
              `https://maps.googleapis.com/maps/api/geocode/json?latlng=${latitude},${longitude}&key=AIzaSyDki4k3wRgR7TEw1ugkkaWqe1tBxxnDfDk`
            );
            const userLocation = response.data.results[0].formatted_address;
            setLocation(userLocation);
            fetchPlaces();
          } catch (error) {
            console.error("Geolocation error:", error);
          }
        },
        (err) => {
          console.error("Geolocation permission denied:", err);
        }
      );
    }
    // eslint-disable-next-line
  }, []);

  const categories = ["schools", "colleges", "theaters", "medical shops"];
  const categoryIcons = {
    schools: "🏫",
    colleges: "🎓",
    theaters: "🎬",
    "medical shops": "💊",
  };

  const handleFilterClick = (category) => {
    setSelectedCategory(category);
  };

  return (
    <div className="min-h-screen bg-gradient-to-b from-blue-50 to-blue-100 p-4">
      <h1 className="text-4xl font-bold text-center mb-8 text-blue-700">
        🌎 Local Explorer
      </h1>

      {/* Search Bar */}
      <div className="flex justify-center mb-6">
        <input
          type="text"
          placeholder="Enter location (e.g., Hyderabad)"
          value={location}
          onChange={(e) => setLocation(e.target.value)}
          className="border border-blue-300 rounded-l px-4 py-2 w-1/2 shadow"
        />
        <button
          onClick={fetchPlaces}
          className="bg-blue-600 text-white px-5 py-2 rounded-r shadow hover:bg-blue-700"
        >
          Search
        </button>
      </div>

      {/* Filter Buttons */}
      <div className="flex justify-center mb-8 flex-wrap gap-2">
        <button
          onClick={() => handleFilterClick("all")}
          className={`px-4 py-2 rounded-full ${
            selectedCategory === "all"
              ? "bg-blue-600 text-white"
              : "bg-white text-blue-700 border border-blue-300"
          }`}
        >
          🌟 All
        </button>
        {categories.map((cat) => (
          <button
            key={cat}
            onClick={() => handleFilterClick(cat)}
            className={`px-4 py-2 rounded-full capitalize ${
              selectedCategory === cat
                ? "bg-blue-600 text-white"
                : "bg-white text-blue-700 border border-blue-300"
            }`}
          >
            {categoryIcons[cat]} {cat}
          </button>
        ))}
      </div>

      {/* Loading */}
      {loading && <p className="text-center text-lg text-blue-700">Loading places...</p>}

      {/* Places Grid */}
      <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6">
        {Object.entries(places)
          .filter(
            ([category]) => selectedCategory === "all" || selectedCategory === category
          )
          .map(([category, placesArray]) => (
            <div key={category}>
              <h2 className="text-2xl font-semibold text-blue-800 mb-3 capitalize">
                {categoryIcons[category]} {category}
              </h2>
              <div className="grid grid-cols-1 gap-4">
                {placesArray.map((place, index) => (
                  <div
                    key={index}
                    className="bg-white rounded-xl shadow-lg hover:shadow-2xl transition duration-300 overflow-hidden"
                  >
                    <img
                      src={place.photo_url}
                      alt={place.name}
                      className="w-full h-48 object-cover"
                    />
                    <div className="p-4">
                      <h3 className="text-lg font-bold text-gray-800">{place.name}</h3>
                      <p className="text-gray-600 text-sm mb-2">
                        {place.formatted_address}
                      </p>
                      {place.rating && (
                        <p className="text-yellow-500 text-sm">⭐ {place.rating}</p>
                      )}
                    </div>
                  </div>
                ))}
              </div>
            </div>
          ))}
      </div>
    </div>
  );
}

export default App;
